import React, { useEffect } from "react";
import "./App.css";

import { useDispatch } from "react-redux";
import {
  BrowserRouter as Router,
  Route,
  Switch,
  withRouter
} from "react-router-dom";

import topNavigationBar from "../src/components/TopNavigationBar";
import { fetchAllUsers } from "./store/users/actions";
import login from "../src/components/login/Login";
import cart from "../src/components/cart/Cart";
import home from "../src/components/Home";
import about from "../src/components/about/About";
import productstore from "../src/components/store/Store";

function App() {
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(fetchAllUsers());
  });
  return (
    <Router>
      <div className="App">
        <div className="container">
          <Switch>
            <Route exact path="/login" component={withRouter(login)} />
            <Route exact path="/home" component={withRouter(home)} />
            <Route exact path="/about" component={withRouter(about)} />
            <Route exact path="/store" component={withRouter(productstore)} />
            <Route exact path="/" component={withRouter(home)} />

            <Route exact path="/cart" component={withRouter(cart)} />
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
